        expect(resBody.esbResponse.header.uniqueReqNo).to.be.a("string")
        expect(resBody.esbResponse.header.channelID).to.be.a("string")
        expect(resBody.esbResponse.header.channelID).to.be.a("string")
        expect(resBody.esbResponse.header.timestamp).to.be.a("string")
